from collections import defaultdict
class Solution:
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        import pdb
        pdb.set_trace()
        p_char_counts = defaultdict(int)
        for c in p:
            p_char_counts[c] += 1
            
        result = []
        s_char_counts = defaultdict(int)
        cur_len = 0
        
        left = 0
        
        for right in range(len(s)):
            c = s[right]
            s_char_counts[c] += 1
            if c in p_char_counts and p_char_counts[c] == s_char_counts[c]:
                cur_len += 1
                
            if cur_len == len(p_char_counts):
                result.append(left)
            
            if right - left + 1 == len(p):
                rem_char = s[left]
                if rem_char in p_char_counts and s_char_counts[rem_char] == p_char_counts[rem_char]:
                    cur_len -= 1
                s_char_counts[rem_char] -= 1
                left += 1
        
        return result
                
